import React from 'react'
import './Serv.css'
export default function Serv() {

  var tablinks = document.getElementsByClassName("tab-links");
  var tabconts = document.getElementsByClassName("tab-content");

  function openTab(tab) {
      for(var onelink of tablinks){
          onelink.classList.remove("active-link");
    }

    for(var onecontent of tabconts){
        onecontent.classList.remove("ative-tab");
    }
    event.currentTarget.classList.add("active-link");
    document.getElementById(tab).classList.add("ative-tab");
}


const list = document.querySelectorAll('.list');
function activeLink() {
    list.forEach((item)=> item.classList.remove('active'));
    this.classList.add('active')
}
list.forEach((item)=> item.addEventListener('click',activeLink));

  return (
    <div className='serv-hero'>
      <div className='serv-top'>
        <div className='content'>
          <h1>iSponsor is a marketplace for finding and publishing event sponsorships.</h1>
          <h3>We make it easy to find and sponsor events to engage with your brandâ€™s target audience</h3>
        </div>
        <div className='serv-top-btns'>
          <button className='serv-btns' onClick={()=>window.location.href="/registerEvent"}>Register your Event</button>
          <button className='serv-btns' onClick={()=>window.location.href="/registerSponsor"}>Register your Sponsorship</button>
        </div>
      </div>
      <div className="serv-center">
        <div className='serv-tabs'>
          <h2 class="tab-links active-link" onclick="openTab('popular')">Most Popular</h2>
          <h2 class="tab-links" onclick="openTab('minuts')">Last Minutes</h2>
          <h2 class="tab-links " onclick="openTab('near')">Near For You</h2>
        </div>

        <dev className='serv-tab-content'  id='near'>
          <div className='near-container'>
              <h2>Under development :) </h2>
          </div>
        </dev>

        <dev className='serv-tab-content'  id='popular'>
          <div className='popular-container'>
            <div  className='popular-card'>
              <div className='popular-img'>
                {/* image here */}
              </div>
              <div className='popular-text'>
                <span>Thu, Jan 10 2024</span>
                <h2> <a href="/"> Dragon & Keros </a></h2>
                <p>Starting at <span>$100</span></p>
              </div>

            </div>

            {/*  card 2 */}

            <div  className='popular-card'>
              <div className='popular-img'>
                {/* image here */}
              </div>
              <div className='popular-text'>
                <span>Thu, Jan 10 2024</span>
                <h2> <a href="#"> Dragon & Keros </a></h2>
                <p>Starting at <span>$100</span></p>
              </div>

            </div>

          </div>
        </dev>

        <dev className='serv-tab-content'  id='minuts'>
          <div className='minuts-container'>
            <h2>Under development :) </h2>
          </div>
        </dev>

      </div>
    </div>
        
  )
}
